/**
 * Asset module that exports the path to the select SVG icon.
 * This module provides access to a static SVG asset used for select/dropdown UI components.
 * 
 * @module SelectAsset
 */

/**
 * The public path to the select icon SVG file.
 * This path is typically resolved by the build system and points to the versioned asset.
 * 
 * @example
 * import selectIconPath from './select-asset';
 * // Use in an img element: <img src={selectIconPath} alt="Select icon" />
 */
declare const selectAssetPath: string;

export default selectAssetPath;